export default function Header (){
    return(
        <>
        <ul>
            <li className="first-item">Home</li>
            <li className="second-item">Blog</li>
            <li className="third-item">News</li>
            <li className="fourth-item">About</li>
            <li className="fifth-item">Contact</li>
        </ul>
        </>
    )
  
}
